function valiDate(str){
	if(str==""){
		return true;
	}
    var reg = /^(\d+)-(\d{1,2})-(\d{1,2})$/;
    var r = str.match(reg);
    if(r==null)return false;
    r[2]=r[2]-1;
    var d= new Date(r[1], r[2],r[3]);
    if(d.getFullYear()!=r[1])return false;
    if(d.getMonth()!=r[2])return false;
    if(d.getDate()!=r[3])return false;
    return true;
}
function valiDateTimes(str){
	var str=$.trim(str);
	if(str==""){
			return true;
		}
     var reg = /^(\d+)-(\d{1,2})-(\d{1,2}) (\d{1,2}):(\d{1,2}):(\d{1,2})$/;
     var r = str.match(reg);
     if(r==null)return false;
     r[2]=r[2]-1;
     var d= new Date(r[1], r[2],r[3], r[4],r[5], r[6]);
     if(d.getFullYear()!=r[1])return false;
	 if(d.getMonth()!=r[2])return false;
     if(d.getDate()!=r[3])return false;
     if(d.getHours()!=r[4])return false;
     if(d.getMinutes()!=r[5])return false;
     if(d.getSeconds()!=r[6])return false;
     return true;
 }

function valiTime(str){
	var str=$.trim(str);
	if(str==""){
		return true;
	}
	var a = str.match(/^(\d{1,2})(:)?(\d{1,2})$/);
	var b = str.match(/^(\d{1,2})(:)?(\d{1,2})\2(\d{1,2})$/);
	if (a == null && b == null) { return false;}
	if(a != null)
	{
		if (a[1]>23|| a[3]>=60 )
		{	
			return false;
		}
	}
	if(b!=null)
	{
		if (b[1]>=24 || b[3]>=60 || b[4]>=60)
		{	
			return false;
		}
	}
	
	return true;
}

function valiInteger(str){
	if(!isNaN(str) && str.indexOf(".")==-1){
		return true;
	}
	return false;
}

function valiDWZDateTimes(_str){
	if(_str==""){
		return true;
	}
	switch (_str.length)
    {
        case 19:
            return valiDateTimes(_str);
        case 10:
        	return valiDate(_str);
        case 8:
        	return valiTime(_str);
        case 5:
        	return valiTime(_str);
        default:
        	return false;
    }
		
}
$.validator.addMethod("date", valiDWZDateTimes);   
